import React, {useState} from "react";

const FullRecord = (rec) => {
    return (
        <div style={{border: 1}}>
            <strong>Имя: </strong> {rec.full_name}, <strong>телефон:</strong> {rec.phone}, <strong>email: </strong> {rec.email} <br />
            <strong>Город: </strong> {rec.city}, улица: {rec.street}, дом: {rec.house}, подъезд: {rec.entrance}, этаж: {rec.floor}, квартира: {rec.office}, домофон: {rec.City}
        </div>
    );
};

export default FullRecord;
